import React from 'react'
import Clock from './Clock'

function Welcome(props) {
  return (
	<div>
	<h1>Hello, {props.name}</h1>
	</div>
	)
}

export default function App() {
    return (
		<div>
		<Welcome name="Sara" />
		<Clock />
		<Toggle />
		</div>

    )
}
